('e4df5e41-c4bf-4ef5-b4f1-c0b678ef8134', 'af3bf4b7-9ee7-438c-832c-e797671c1bbc', 'content', 'Virtual Host l mt cu hnh trong Apache  cho php nhiu domain cng chy trn mt my ch. C mt khi nim khc c  cp ti trong Nginx cng c chc nng tng t nh Virtual Host c gi l Server Block. Trong Log ny mnh ch mun chia s vi cc bn cn l lm v Vhost cch  cu hnh mt Virtual Host trong Windows,  y mnh s dng XAMPP lm mi trng php trin.\n\n\nTi s demo video ny trn hai nn tng  l Window. Bn c th xem nhiu video na trn https://gsviec.com', 'Virtual Host l mt cu hnh trong Apache  cho php nhiu domain cng chy trn mt my ch. C mt khi nim khc c  cp ti trong Nginx cng c chc nng tng t nh Virtual Host c gi l Server Block. Trong Log ny mnh ch mun chia s vi cc bn cn l lm v Vhost cch  cu hnh mt Virtual Host trong Windows,  y mnh s dng XAMPP lm mi trng php trin.\r\n\r\n```\r\n<VirtualHost *:80>\r\n  DocumentRoot \"C:/xampp/htdocs/hello\"\r\n  ServerName gsviec.dev\r\n   <Directory \"C:/xampp/htdocs/hello\">\r\n       Order allow,deny\r\n        Allow from all\r\n  </Directory>\r\n</VirtualHost>\r\n\r\n```\r\nTi s demo video ny trn hai nn tng  l Window. Bn c th xem nhiu video na trn https://gsviec.com'),
