INSERT INTO `playlist` (`id`, `usersId`, `title`, `slug`, `content`, `imageFilename`, `createdAt`, `status`) VALUES
(1, 16, 'Git v GitHub Cn Bn', 'git-va-github-can-ban', 'Trong serie ny, bn s c lm quen vi h thng Git v cch s dng n. Bn s hiu c cc khi nim v thut ng trong Git nh Clone, Branch, Stage, Commit, Tracking, Merge, Pull, Push\n\nng thi bn s lm quen vi Github v cch dng n cho cc d n ca bn chng ti huy vng cc bn s thy hu ch khi hc kho hc ny. Thanks', 'git-and-github-basic.png', 1489917528, 'active'),
(2, 16, 'Kho hc PHP cn bn', 'khoa-hoc-php-can-ban', 'Nhn thy c nhiu bn tr mun hc PHP  pht trin web nhng cha c kin thc cn bn v n, v vy ti quyt nh m kho hc Lp trnh PHP \r\n\r\nKho hc php cn bn dnh cho cc bn mi tm hiu v PHP, chng trnh o to t nhng ci c bn nht n chuyn su. Sau khi kt thc kha hc cn bn bn c th vit c mt website c bn.\r\n\r\nTon b m ngun code cc bn c th xem trn GITHUB https://github.com/gsviec/phpbegin', 'php-basic.png', 1490075550, 'active'),
(3, 16, 'Kho hc Phalcon 101', 'khoa-hoc-phalcon-can-ban', 'Trong hn 3 nm qua ti  nghin cu v lm vic trn Phalcon Framework  xy dng ng dng online theo yu cu ca khch hng. Trong qu trnh xy  v pht trin dng d n cho khch hng,  chng ti  nhn thy nhng u im vt tri ca Phalcon framework  so vi cc PHP framework\r\n\r\nV vy ti quyt nh m kha hc Phalcon ny  chia s nhng hiu bit ca ti cho cc bn tr mun hc Phalcon. Ton b m ngun kha hc bn c th xem https://github.com/gsviec/phalcon-canban ', 'phalcon.png', 1490075550, 'active'),
(4, 16, 'Kha Hc WordPress Cn Bn', 'khoa-hoc-wordpress-can-ban', 'Trong serie bi hc ny, bn s bt u t nhng kin thc c bn nht cc k cn thit i vi tt c nhng ngi c mong mun t lm v qun tr c mt website bng WordPress.\r\n\r\nBn s t lm c t nht mt website hon chnh. Sau ny khng cn thu ai na, thch web no l lm web . Thit k web khng kh nh bn tng. Hc MT ln, dng C I!', 'wordpress001.jpg', 1490414092, 'active'),
(5, 16, 'Kha Hc Magento 2 Cn Bn', 'khoa-hoc-magento-2-can-ban', 'Trong serie bi hc ny, bn s bt u t nhng kin thc c bn nht cc k cn thit i vi tt c nhng ngi c mong mun t lm v qun tr c mt website bn hng online\r\n\r\nBn s t lm c t nht mt website hon chnh. Sau ny khng cn thu ai na, thch web no l lm web . Thit k web khng kh nh bn tng. Hc MT ln, dng C I!', 'magento.png', 1490414092, 'active'),
(6, 16, 'Kha Hc Amazon Web Service cn bn', 'khoa-hoc-amazon-web-service-can-ban', 'Trong serie kha hc ny, bn s c cc khi nim cn bn v S3, EC2, Cch tnh chi ph dch v AWS cng nh cc khi nim cn bn v n.\n\nNgoi ra cui kha hc ti s hng dn bn cch s dng S3  cha hnh nh hoc Video v s dng CloudFront lm CDN cho website ca bn m c th l Wordpress\n\nCui cng l phn nng cao cung cp cc dng lnh  x l AWS cng nh scale website vi ELB v nhiu hn th na\n', 'aws.jpg', 1490414092, 'active'),
(7, 16, 'Kha Hc Docker cn bn', 'khoa-hoc-docker-can-ban', 'Trong serie bi hc ny, bn s c cc khi nim cn bn v Docker, cch dng n vo cc d n thc t nh Wordpress, Phalcon v Magento\r\n\r\n\r\nBn s hiu c cch s dng Docker Compose, cch to t dng mt image Docker\r\nTon b m ngun demo bn c th ti qua ng dn ny [https://github.com/gsviec/docker-canban](https://github.com/gsviec/docker-canban)', 'docker.png', 1490414099, 'active'),
(8, 16, 'Kho hc Phalcon 102', 'khoa-hoc-phalcon-102', 'Trong kha hc Phalcon trc ti  hng dn cc bn hiu cc khi nim cn bn v cu trc cng nh cch hot ng Phalcon PHP. V vy trong kha hoc ny ti s tp trung hng dn bn x l phn models v form trong Phalcon\r\n\r\nTon b m ngun kha hc bn c th xem https://github.com/gsviec/phalcon-canban ', 'phalcon.png', 1494323442, 'active'),
(9, 16, 'Kho hc VPS cn bn', 'khoa-hoc-vps-can-ban', 'Kha hc Ci t v Qun tr Linux Server cung cp cho hc vin cc kin thc v k nng quan trng nht  c th lm ch cc tin trnh Ci t v Qun tr mt Linux Server v cc dch v mng km theo.\r\n\r\nTon b m ngun kha hc bn c th xem https://github.com/gsviec/linux-canban ', 'vps-basic.png', 1494323442, 'active'),
(10, 16, 'Kha Hc Amazon Web Service cn bn 002', 'khoa-hoc-amazon-web-service-can-ban-002', 'Trong serie kha hc ny, bn s c cc khi nim cn bn v S3, EC2, Cch tnh chi ph dch v AWS cng nh cc khi nim cn bn v n.\r\n\r\nNgoi ra cui kha hc ti s hng dn bn cch s dng S3  cha hnh nh hoc Video v s dng CloudFront lm CDN cho website ca bn m c th l Wordpress\r\n\r\nCui cng l phn nng cao cung cp cc dng lnh  x l AWS cng nh scale website vi ELB v nhiu hn th na\r\n', 'aws.jpg', 1490414092, 'active');
INSERT INTO `posts` (`id`, `usersId`, `type`, `techOrder`, `title`, `link`, `slug`, `content`, `excerpt`, `thumbnail`, `filename`, `videoFilename`, `duration`, `categoryId`, `tags`, `numberViews`, `numberReply`, `createdAt`, `modifiedAt`, `editedAt`, `status`, `locked`, `deleted`, `acceptedAnswer`, `monetize`, `sticked`) VALUES
(1, 16, 'video', 'youtube', 'Gii thiu bin trong PHP', NULL, 'gioi-thieu-bien-trong-php', 'C php PHP l ging nh cc ngn ng C, JavaScript n l tp hp ca cc k t dng lnh hoc biu thc, nu bn c hc qua th tt khng hc th cng ch sao:', NULL, 'https://i.ytimg.com/vi/q-A3QFcUvKk/mqdefault.jpg', NULL, 'q-A3QFcUvKk', '0:3:59', 1, 'php,gsviec,php-can-ban', 341, 0, 1489717284, 1490757906, 1490757906, 'active', 'N', 0, 'N', 'N', 'N'),
(3, 16, 'video', 'youtube', 'Nhng code PHP vo trong HTML', NULL, 'nhng-code-php-vo-trong-html', 'Trong video ny ti s hng dn cc bn nhng m code PHP vo trong HTML\r\n\r\n xem nhiu video bn c th vo trang https://gsviec.com', NULL, 'https://i.ytimg.com/vi/iqtlFAfl2wQ/mqdefault.jpg', NULL, 'iqtlFAfl2wQ', '0:5:8', 1, 'php,html,gsviec,hoc-php-can-ban', 791, 0, 1489717752, 1490757910, 1490757910, 'active', 'N', 0, 'N', 'N', 'N'),
(4, 16, 'video', 'youtube', 'Gii thiu trnh son tho code Sublime text', NULL, 'gioi-thieu-trinh-soan-thao-code-sublime-text', 'Trong video ny ti s hng dn cc bn cch ci dt trnh son tho Sublime text v gii thiu tnh nng c bn ca n, cui cng l gi thch ti sao bn nn dng n\r\n\r\n xem nhiu video bn c th xem trn https://gsviec.com', NULL, 'https://i.ytimg.com/vi/jk7nZSHQzS4/mqdefault.jpg', NULL, 'jk7nZSHQzS4', '0:3:50', 10, 'php,sublimetext,gsviec,trinh soan thao', 289, 0, 1489737666, 1490690592, 1490690592, 'active', 'N', 0, 'N', 'N', 'N'),
(5, 16, 'video', 'youtube', 'Gii thiu IDE PHPSTORM', NULL, 'gioi-thieu-ide-phpstorm', 'Trong video ny ti s gii thiu cc bn mt IDE cc mnh  pht trin ng dng PHP  l PhpStorm\r\n\r\nBn c th mun xem cc video khc ti https://gsviec.com', NULL, 'https://i.ytimg.com/vi/-WJoiJygNi0/mqdefault.jpg', NULL, '-WJoiJygNi0', '0:6:16', 10, 'phpstorm,php,editor,ide', 258, 0, 1489739332, 1490743887, 1490743887, 'active', 'N', 0, 'N', 'N', 'N'),
(6, 16, 'video', 'youtube', 'Gii thiu tng quan v Git v Github', NULL, 'gioi-thieu-tong-quan-ve-git-va-github', 'Git v Github c s dng kh ph bin trong gii lp trnh vin, chc hn bn s thy nhiu ng kho m ngun c link t Github.com. N rt tin li v an ton, p ng tt cc nhu cu lm vic nhm.  s dng Git v Github bn cn c nhng kin thc c bn dng lnh trn Linux (v c bn Git c xy dng trn Linux).', NULL, 'https://i.ytimg.com/vi/bZQYowFKbns/mqdefault.jpg', NULL, 'bZQYowFKbns&feature=youtu.be', '0:3:52', 10, 'github,git,gsviec,devops,tool,hoc lap trinh', 515, 0, 1489758094, 1490743876, 1490743876, 'active', 'N', 0, 'N', 'N', 'N'),
(7, 16, 'video', 'youtube', 'Gii thiu Bitbucket', NULL, 'gioi-thieu-bitbucket', 'Nu bn no  tng s dng Github th cng bit n c mt nhc im  l chi ph cho gi private kh l mc, so vi ngi dng c nhn do  hm nay ti gii thiu bn Bitbucket n cng nh Github nhng c gi private min ph cho bn', NULL, 'https://i.ytimg.com/vi/Uuz1gIDHBkE/mqdefault.jpg', NULL, 'Uuz1gIDHBkE', '0:2:53', 10, 'bitbucket,devops,github,git,luu tru code,gsviec,yt:crop=16:9', 277, 0, 1489770183, 1490738861, 1490738861, 'active', 'N', 0, 'N', 'N', 'N'),
(8, 16, 'video', 'youtube', 'Hng dn ci t Git v Github trn Window', NULL, 'huong-dan-cai-at-git-va-github-tren-window', 'Trong video ny ti s hng dn cc bn ci git, mc nh bn c th vo trang ch git ti n v v ci t, nhng bn nn ci ci github GUI n s ci cho bn c git v GUI Github thun tin hn cho vic qun l code sau ny', NULL, 'https://i.ytimg.com/vi/zU2s7SbClaw/mqdefault.jpg', NULL, 'zU2s7SbClaw&feature=youtu.be', '0:2:24', 4, 'php,yt:quality=high,yt:crop=16:9,gsviec,git,github,window', 441, 0, 1489896537, 1490757897, 1490757897, 'active', 'N', 0, 'N', 'N', 'N'),
(9, 16, 'video', 'youtube', 'Lm quen giao din trn Github', NULL, 'lam-quen-giao-dien-tren-github', 'Trong bi hc ny ti s gii thiu cc bn v giao din ca Github nh l to mt t chc hoc cng ty dng  cha m ngun code, v gii thch l do ti sao bn nn lm th\r\n\r\nBn c th xem nhiu video na trn https://gsviec.com', NULL, 'https://i.ytimg.com/vi/M3cUVKDWTyA/mqdefault.jpg', NULL, 'M3cUVKDWTyA', '0:5:36', 4, 'php,yt:quality=high,yt:crop=16:9,gsviec', 322, 0, 1489898154, 1490738572, 1490738572, 'active', 'N', 0, 'N', 'N', 'N'),
(10, 16, 'video', 'youtube', 'Thit lp chng thc c nhn cho git', NULL, 'thiet-lap-chung-thuc-ca-nhan-cho-git', 'Trong bi hc ny ti s hng dn cc bn cch cu hnh git trc khi bn commit(a) code ln github, cng nh to mt mt repo trn github v cui cng l invited mt thnh vin tham gia vo t chc\r\n\r\nTi s demo video ny trn hai nn tng  l Window v MacOS. Bn c th xem nhiu video na trn https://gsviec.com', NULL, 'https://i.ytimg.com/vi/XHUZkjNbDdw/mqdefault.jpg', NULL, 'XHUZkjNbDdw', '0:6:29', 4, 'php,yt:quality=high,yt:crop=16:9,gsviec,git,cau hinh github tren window', 374, 0, 1489915162, 1490717767, 1490717767, 'active', 'N', 0, 'N', 'N', 'N'),
(11, 16, 'video', 'youtube', 'Cu hnh SSH Key cho Github', NULL, 'cau-hinh-ssh-key-cho-github', 'Trong bi hc ny ti s hng dn cc bn cch to ssh-key trn window, sau  thm ssh-key ny vo config trn github  mi ln bn commit(a) code ln Github khng yu cu mt khu na.\r\n\r\nTi s demo video ny trn hai nn tng  l Window v MacOS. Bn c th xem nhiu video na trn https://gsviec.com', NULL, 'https://i.ytimg.com/vi/52frYwwVceM/mqdefault.jpg', NULL, '52frYwwVceM', '0:4:45', 4, 'php,yt:quality=high,yt:crop=16:9,gsviec,ssh,github,git', 408, 0, 1489917053, 1490766443, 1490766443, 'active', 'N', 0, 'N', 'N', 'N'),
(12, 16, 'video', 'youtube', 'Ci t XAMP trn Window', NULL, 'cai-at-xamp-tren-window', 'XAMPP l mi trng pht trin web trn h iu hnh Windows, Linux, Mac OS, Solaris. N cho php bn to cc ng dng web vi Apache2, PHP, Perl v MySQL. Bn cnh , PhpMyAdmin cho php qun l c s d liu d dng.\r\n\r\nNhng bn thng dng XAMP cho Window thi, ch t c ai dng n cho Linux:) ngoi ra XAMPP l vit tt ca cc t: Apache, MySQL, PHP v Perl.\r\n\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/-3B1vR7EVGo/mqdefault.jpg', NULL, '-3B1vR7EVGo', '0:9:18', 10, 'php,yt:quality=high,yt:crop=16:9,gsviec,xamp,window,lap trinh web php,hoc lap trinh web,moi truong phat trien web', 275, 0, 1489981992, 1490697315, 1490697315, 'active', 'N', 0, 'N', 'N', 'N'),
(13, 16, 'video', 'youtube', 'Cu hnh Virtual Host trong XAMPP', NULL, 'cau-hinh-virtual-host-trong-xampp', 'Virtual Host l mt cu hnh trong Apache  cho php nhiu domain cng chy trn mt my ch. C mt khi nim khc c  cp ti trong Nginx cng c chc nng tng t nh Virtual Host c gi l Server Block. Trong Log ny mnh ch mun chia s vi cc bn cn l lm v Vhost cch  cu hnh mt Virtual Host trong Windows,  y mnh s dng XAMPP lm mi trng php trin.\r\n\r\n```\r\n<VirtualHost *:80>\r\n  DocumentRoot \"C:/xampp/htdocs/hello\"\r\n  ServerName gsviec.dev\r\n   <Directory \"C:/xampp/htdocs/hello\">\r\n       Order allow,deny\r\n        Allow from all\r\n  </Directory>\r\n</VirtualHost>\r\n\r\n```\r\nTi s demo video ny trn hai nn tng  l Window. Bn c th xem nhiu video na trn https://gsviec.com', NULL, 'https://i.ytimg.com/vi/dYSHMuVpZ98/mqdefault.jpg', NULL, 'dYSHMuVpZ98', '0:7:49', 10, 'php,yt:quality=high,yt:crop=16:9,gsviec,Virtual,host,xamp,window', 540, 0, 1489984522, 1490767584, 1490767584, 'active', 'N', 0, 'N', 'N', 'N'),
(14, 16, 'video', 'youtube', 'Tach ma PHP va HTML trong lap trinh PHP', NULL, 'ta-ch-ma-php-va-html-trong-la-p-tri-nh-php', 'Bn  kh quen thuc vi vic vit m PHP v HTML, Css, javascript,... vo chung mt tp tin php  thc thi cu lnh PHP. iu ny lm code ca bn tr nn ri v kh qun l.\r\n\r\nTrong video ny ti s hng dn cc bn cch tch m code PHP v HTML ra ring bit  cho vic qun l code d hn cng nh maintainers d dng hn', NULL, 'https://i.ytimg.com/vi/rHjYO75Yne0/mqdefault.jpg', NULL, 'rHjYO75Yne0', '0:6:29', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,html,mvc,php can ban,hoc php', 622, 0, 1489998392, 1490759955, 1490759955, 'active', 'N', 0, 'N', 'N', 'N'),
(15, 16, 'video', 'youtube', 'Kha hc Docker Cn bn', NULL, 'khoa-hoc-docker-can-ban', 'Gn y Docker ang c tho lun v gy c nhiu ch  trong cng ng cng ngh trn th gii, vi nhiu ha hn trong tng lai. Cc hng cng ngh ln nh Google, Amazon, Microsoft  bt u h tr Docker trn nn tng ca h, v  Si gn c lun cng ng Docker nu bn thch c th tham gia meetup ti y  Vy Docker l g?', NULL, 'https://i.ytimg.com/vi/tZS3JHq-GKs/mqdefault.jpg', NULL, 'tZS3JHq-GKs', '0:2:58', 10, 'php,yt:quality=high,yt:crop=16:9,gsviec,docker,dcoker composer', 1690, 0, 1490002534, 1490766686, 1490766686, 'active', 'N', 0, 'N', 'N', 'N'),
(16, 16, 'video', 'youtube', 'Gii thiu mng trong PHP', NULL, 'gioi-thieu-mang-trong-php', 'Cng nh bao ngn ng lp trnh khc. PHP cng tn ti mt loi d liu c gi l mng. C th hn Mng l 1 bin danh sch. Ngha l, mt bin vn cha nhiu phn t c to bi cc s hoc chui. N cho php chng ta lu tr, sp xp th t v truy cp nhiu gi tr vi mt tn. V cn lu  rng mt phn t mng lun bt u vi gi tr l 0.', NULL, 'https://i.ytimg.com/vi/56Z0KXbXsTA/mqdefault.jpg', NULL, '56Z0KXbXsTA', '0:9:26', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,php can ban,lap trinh web,array trong php', 156, 0, 1490088723, 1490743880, 1490743880, 'active', 'N', 0, 'N', 'N', 'N'),
(17, 16, 'video', 'youtube', 'Gii thiu phng thc GET v POST trong PHP', NULL, 'gioi-thieu-phuong-thuc-get-va-post-trong-php', 'Khi lm vic vi bt k hnh thc Form no trong PHP nh to account, reset pasword, tm kim th dng hai phng thc trn l khng th thiu. Do  video ny ti s hng dn cc bn cch dng n huy vng bn s hiu cch dng n', NULL, 'https://i.ytimg.com/vi/LUCFGIMYTyc/mqdefault.jpg', NULL, 'LUCFGIMYTyc&feature=youtu.be', '0:5:28', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,post,get,form trong php', 199, 0, 1490090673, 1490724607, 1490724607, 'active', 'N', 0, 'N', 'N', 'N'),
(18, 16, 'video', 'youtube', 'Gii thiu boolean trong PHP', NULL, 'gioi-thieu-boolean-trong-php', '\"Boolean\" l mt thut ng rt ng s, nhng n l n gin  hiu.  l kiu d liu th hin mt trong hai gi tr: ng hoc sai. N dng nh l xut hin lin tc trong cc d n ca bn. V vy, iu quan trng trc khi lm cc d n PHP thc t bn cn phi hiu n', NULL, 'https://i.ytimg.com/vi/IDZoKpNLusw/mqdefault.jpg', NULL, 'IDZoKpNLusw&feature=youtu.be', '0:11:55', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,boolean,hoc lap trinh php', 184, 0, 1490153186, 1490717765, 1490717765, 'active', 'N', 0, 'N', 'N', 'N'),
(19, 16, 'video', 'youtube', 'Gii thiu cc lnh cn bn thng dng trong GIT', NULL, 'gioi-thieu-cac-lenh-can-ban-thuong-dung-trong-git', 'Trong bi hc ny ti s hng dn cc bn cc lnh cn bn ca git nh:\r\n\r\n- git add: dng  thm file trc khi commit, v d git add README.md, nu bn mun thm nhiu file th dng git add A\r\n\r\n- git commit: trc khi push code th bn c cn phi ni r  ngha ca on code  lm chc nng\r\n\r\n- git staus: xem bn   branch(nhnh) no.\r\n\r\n- git push: y code lnh repo trong trng hp ny l github\r\n\r\n- git pull: ko code v t remote repo\r\n\r\n\r\nTi s demo video ny trn hai nn tng  l Window v MacOS. Bn c th xem nhiu video na trn https://gsviec.com', NULL, 'https://i.ytimg.com/vi/L6kaDUzBvZ4/mqdefault.jpg', NULL, 'L6kaDUzBvZ4', '0:9:17', 4, 'php,yt:quality=high,yt:crop=16:9,gsviec,git can ban', 325, 0, 1490158799, 1490733677, 1490733677, 'active', 'N', 0, 'N', 'N', 'N'),
(20, 16, 'video', 'youtube', 'Gii thiu tnh nng pull request v branch trong GIT', NULL, 'gioi-thieu-tinh-nang-pull-request-va-branch-trong-git', 'Trong bi hc ny ti s hng dn cc bn cc khi nim branch v pull request l g v cch dng n nh th no\r\n\r\nTi s demo video ny trn hai nn tng  l Window v MacOS. Bn c th xem nhiu video na trn https://gsviec.com', NULL, 'https://i.ytimg.com/vi/qOq1XHxrEi4/mqdefault.jpg', NULL, 'qOq1XHxrEi4&feature=youtu.be', '0:11:57', 4, 'php,yt:quality=high,yt:crop=16:9,gsviec,branch,pull request,git', 343, 0, 1490173087, 1490710943, 1490710943, 'active', 'N', 0, 'N', 'N', 'N'),
(21, 16, 'video', 'youtube', 'Backup d liu wordpress  qua GIT', NULL, 'backup-du-lieu-wordpress-qua-git', 'Nu nh cc bn mun tracking hay backup m ngun wordpress trn VPS ca bn th video ny dnh cho bn\r\n\r\n xem nhiu video hn bn c th truy cp vo https://gsviec.com', NULL, 'https://i.ytimg.com/vi/Bi3jKNK0BU8/mqdefault.jpg', NULL, 'Bi3jKNK0BU8&feature=youtu.be', '0:3:54', 4, 'php,yt:quality=high,yt:crop=16:9,gsviec,wordpress,backkup,git,bitbucket', 212, 0, 1490241215, 1490759953, 1490759953, 'active', 'N', 0, 'N', 'N', 'N'),
(22, 16, 'video', 'youtube', 'Reset, Revert va amend trong GIT', NULL, 'reset-revert-va-amend-trong-git', 'Mt vic bn s kh thng xuyn lm trong Git nu lm vic theo nhm  l kim tra xem nhng ai  commit vo d n bn ang lm vic, cng nh cch bn undo ln commit trc  nu nh bn cm thy mnh thiu mt tp tin no  trong ln commit trc  b sung vo.', NULL, 'https://i.ytimg.com/vi/XHSo4g-UHBY/mqdefault.jpg', NULL, 'XHSo4g-UHBY&feature=youtu.be', '0:8:42', 4, 'php,yt:quality=high,yt:crop=16:9,gsviec,git,github,revert,reset', 376, 0, 1490242361, 1490757904, 1490757904, 'active', 'N', 0, 'N', 'N', 'N'),
