(28, 16, 'video', 'youtube', 'Cu hnh Vhost trn XAMP cho Wordpress', NULL, 'cau-hinh-vhost-tren-xamp-cho-wordpress', 'Vic dng mc nh ng dn khi bn ci t Wordpress trn XAMP khng c vn  g c, nhng nhn n khng chuyn nghip cng nh khng ging thc t ca mt domain do  trong video ny ti s hng dn bn thy i domain cho n.\r\n\r\nBn c th copy on code di y  dn vo http.conf\r\n\r\n```\r\n<VirtualHost *:80>\r\n    DocumentRoot \"C:/xampp/htdocs/hello\"\r\n  ServerName gsviec.dev\r\n   <Directory \"C:/xampp/htdocs/hello\">\r\n       Order allow,deny\r\n        Allow from all\r\n  </Directory>\r\n</VirtualHost>\r\n\r\n```', NULL, 'https://i.ytimg.com/vi/1Krr5OedGy0/mqdefault.jpg', NULL, '1Krr5OedGy0&feature=youtu.be', '0:5:52', 2, 'php,yt:quality=high,yt:crop=16:9,gsviec,wordpress,wordpress can ban,xamp,vhost', 273, 0, 1490329114, 1490757899, 1490757899, 'active', 'N', 0, 'N', 'N', 'N'),
(29, 16, 'video', 'youtube', 'Ci t Plugin v Theme trong Wordpress', NULL, 'cai-at-plugin-va-theme-trong-wordpress', 'Nh bn bit  l khi ci t xong WordPress th cng vic tip theo l ci t cc theme v plugin  gip cho website ngon hn, do  trong video ny ti s hng dn cc bn ci t n\r\n\r\nNu bn ci trren XAMP s khng b li i FTP,  cn Linux s gp li th bn xem bi vit https://gsviec.com/blog/tat-tai-khoan-ftp-khi-upload-theme-trong-wordpress  khc phc', NULL, 'https://i.ytimg.com/vi/QGe8hCbWt_0/mqdefault.jpg', NULL, 'QGe8hCbWt_0&feature=youtu.be', '0:6:8', 2, 'php,yt:quality=high,yt:crop=16:9,gsviec,wordpress,wordpress can ban,plugin,theme,ftp', 281, 0, 1490330086, 1490752130, 1490752130, 'active', 'N', 0, 'N', 'N', 'N'),
