(32, 16, 'video', 'youtube', 'Qun l User trong Wordpress', NULL, 'quan-ly-user-trong-wordpress', 'Bt c nn tng CMS no th phn quyn cho user truy cp cho ti nguyn l iu cn thit, v vy trong video ny ti s gii thiu tnh nng qun l mc nh trong Wordpress', NULL, 'https://i.ytimg.com/vi/MmL3dZsDHrU/mqdefault.jpg', NULL, 'MmL3dZsDHrU&feature=youtu.be', '0:5:8', 2, 'php,yt:quality=high,yt:crop=16:9,gsviec,wordpress,quan ly user', 128, 0, 1490350852, 1490625910, 1490625910, 'active', 'N', 0, 'N', 'N', 'N'),
