(34, 16, 'video', 'youtube', 'Kha Hc  WordPress Cn Bn', NULL, 'khoa-hoc-wordpress-can-ban', 'Trong serie bi hc ny, bn s bt u t nhng kin thc c bn nht cc k cn thit i vi tt c nhng ngi c mong mun t lm v qun tr c mt website bng WordPress.\r\n\r\n\r\nBn s t lm c t nht mt website hon chnh. Sau ny khng cn thu ai na, thch web no l lm web . Thit k web khng kh nh bn tng. Hc MT ln, dng C I!', NULL, 'https://i.ytimg.com/vi/jxp-cl3uIk0/mqdefault.jpg', NULL, 'jxp-cl3uIk0&feature=youtu.be', '0:0:58', 2, 'php,yt:quality=high,yt:crop=16:9,gsviec,wordpress', 320, 0, 1490411701, 1490757895, 1490757895, 'active', 'N', 0, 'N', 'N', 'N'),
(35, 16, 'video', 'youtube', 'Gii thiu Category v Tag', NULL, 'gioi-thieu-category-va-tag', 'Category ngha l mt nhm bao qut cha cc bi vit trong blog. N ging nh nhng ci cp giy v cc t giy l nhng bi vit c cha  trong . Category c th c phn cp, tc l mt Category c th bao gm nhiu Category nh khc  trong.\r\n\r\nTag ngha l mt php phn loi c bit ca bi vit  m t c th cc ch  lin quan. Nu ta xem Category l cp sch, bi vit l giy th Tag cng c xem l nhng ci kp giy  kp mt s bi vit c lin quan li vi nhau.', NULL, 'https://i.ytimg.com/vi/6OdX1dAw-is/mqdefault.jpg', NULL, '6OdX1dAw-is&feature=youtu.be', '0:3:25', 2, 'php,yt:quality=high,yt:crop=16:9,gsviec,wordpress,tag,cat,category', 204, 0, 1490412009, 1490692639, 1490692639, 'active', 'N', 0, 'N', 'N', 'N'),
(36, 16, 'video', 'youtube', 'Gii thiu Plugin FakerPress  to d liu', NULL, 'gioi-thieu-plugin-fakerpress-e-tao-du-lieu', 'Cho cc bn, hm nay ti s gii thiu cc bn dng mt th vin  l Faker  to ra gi liu gi cho trang web ca chng ta. Nh cc bn bit vic dng d liu tht  trong mi trng development l mt  tng rt l t.\r\n\r\nBn c th xem bi vit v faker ti y https://gsviec.com/blog/huong-dan-dung-faker-de-tao-du-lieu-cho-moi-truong-phat-trien', NULL, 'https://i.ytimg.com/vi/vJOAALPgMaE/mqdefault.jpg', NULL, 'vJOAALPgMaE&feature=em-upload_owner', '0:7:45', 2, 'php,yt:quality=high,yt:crop=16:9,gsviec,fakerpress,fakedata,wordpress', 277, 0, 1490412301, 1490749508, 1490749508, 'active', 'N', 0, 'N', 'N', 'N'),
(37, 16, 'video', 'youtube', 'Chn Editor hoc IDE ph hp  vit code', NULL, 'chon-editor-hoac-ide-phu-hop-e-viet-code', 'Nh bn bit l  vit code PHP th ta c th dng notepad  vit cng c nhng khng ai lm th c, v vy ti s a cho bn nhng li khuyn chn IDE hay Editor hp l khi bt u hc PHP', NULL, 'https://i.ytimg.com/vi/G4aUHNZlWP4/mqdefault.jpg', NULL, 'G4aUHNZlWP4&feature=youtu.be', '0:2:4', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,editor,ide,sublimetext,atom,phpstorm', 778, 0, 1490447099, 1490759946, 1490759946, 'active', 'N', 0, 'N', 'N', 'N'),
