(39, 16, 'video', 'youtube', 'Li m u', NULL, 'loi-mo-au', 'Nhn thy c nhiu bn tr mun hc PHP  pht trin web nhng cha c kin thc cn bn v n, v vy ti quyt nh m kho hc Lp trnh PHP\r\n\r\nKho hc php cn bn dnh cho cc bn mi tm hiu v PHP, chng trnh o to t nhng ci c bn nht n chuyn su. Sau khi kt thc kha hc cn bn bn c th vit c mt website c bn.\r\n\r\nBn c th xem y  video ti y https://gsviec.com/playlist/khoa-hoc-php-can-ban', NULL, 'https://i.ytimg.com/vi/fO8SaxPAdBI/mqdefault.jpg', NULL, 'fO8SaxPAdBI&feature=youtu.be', '0:1:27', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,php can ban,hoc lap trimh php', 239, 0, 1490498484, 1490729131, 1490729131, 'active', 'N', 0, 'N', 'N', 'N'),
(40, 16, 'video', 'youtube', 'Cu iu kin trong PHP', NULL, 'cau-ieu-kien-trong-php', 'Cu iu kin dng  thc hin nhng hnh ng khc nhau trong nhng iu kin khc nhau. Cu iu kin rt thng xuyn c s dng khi vit m cho bt k ngn ng lp trnh no.\r\n\r\nCu iu kin thng c s dng trong PHP l cu iu kin IF, trong video ny ti s hng dn bn cch dng n', NULL, 'https://i.ytimg.com/vi/CY5tb6T41sA/mqdefault.jpg', NULL, 'CY5tb6T41sA&feature=youtu.be', '0:6:48', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,condition,cau dien kien php,if va else', 180, 0, 1490503601, 1490745212, 1490745212, 'active', 'N', 0, 'N', 'N', 'N'),
(41, 16, 'video', 'youtube', 'Khi nim v hm v gi li hm trong PHP', NULL, 'khai-niem-ve-ham-va-goi-lai-ham-trong-php', ' gim thi gian lp li 1 thao tc code nhiu ln, PHP h tr ngi lp trnh vic t nh ngha cho mnh nhng hm c kh nng lp li nhiu ln trong website. Vic ny cng gip cho ngi lp trnh kim sot m ngun mt cch mch lc. ng thi c th ty bin  mi trang. M khng cn phi khi to hay vit li m lnh nh HTML thun.\r\n\r\n### C php\r\n\r\n```\r\n\r\n\r\nfunction ten_function($gt1,$gt2){\r\n\r\n//Hnh ng\r\n\r\n}\r\n```', NULL, 'https://i.ytimg.com/vi/tKZP-JxmL7k/mqdefault.jpg', NULL, 'tKZP-JxmL7k&feature=em-upload_owner', '0:5:24', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,function trong php,function', 661, 0, 1490590971, 1490759944, 1490759944, 'active', 'N', 0, 'N', 'N', 'N'),
(42, 16, 'video', 'youtube', 'Gii thiu MySQL', NULL, 'gioi-thieu-mysql', 'Khi bn tm kim trn Goole t kho nh hc lp trnh web, hay ci t WordPress bn s thy c mt cm t l Mysql, vy n l g trong bi vit ny ti s gii thch Mysql l g ti sao n l cn thit.', NULL, 'https://i.ytimg.com/vi/VyGUn3aJFv4/mqdefault.jpg', NULL, 'VyGUn3aJFv4', '0:10:7', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,mysql,php can ban', 490, 0, 1490591584, 1490763264, 1490763264, 'active', 'N', 0, 'N', 'N', 'N'),
(43, 16, 'video', 'youtube', 'Gii thiu class PDO', NULL, 'gioi-thieu-class-pdo', 'PDO l API cung cp cho chng ta  kt ni cng nh thao tc vi CSDL, chuyn d liu thnh cc i tng  chng ta d thao tc. Hin tai PDO h tr khong 12 loi h qun tr CSDL khc nhau, khng ging nh mysqli ch h tr MySQL. PDO ra i  lm cho PHP  mnh li cng tr nn mnh m hn.', NULL, 'https://i.ytimg.com/vi/vNgOGMjA9D4/mqdefault.jpg', NULL, 'vNgOGMjA9D4', '0:11:43', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,pdo,php can ban', 388, 0, 1490593241, 1490759942, 1490759942, 'active', 'N', 0, 'N', 'N', 'N'),
(44, 16, 'video', 'youtube', 'Ti cu trc (refactor) li on PDO', NULL, 'tai-cau-truc-refactor-lai-oan-pdo', 'Ti cu trc (refactor) li on code ca bn,  hiu r refactor l g th bn c th hiu nh sau:\r\n\r\nRefactoring khng n gin l lm cho code mnh r rng hn m cn l cch b cc li code sao cho n thnh cc part (thng thng, ngi ta a cc x l, thut ton thnh cc method), ti u thut ton, t chc li bin... lm sao n (l class, hay ln hn l module) c th c s dng li  u , hay  nng cp d dng (hn ch cc xung t hay chnh sa qu nhiu trong system mi)\r\n', NULL, 'https://i.ytimg.com/vi/3sr60LPcpQ4/mqdefault.jpg', NULL, '3sr60LPcpQ4&feature=youtu.be', '0:16:51', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,pdo,refactor,tai cau truc code,php can ban', 156, 0, 1490672521, 1490675529, 1490675529, 'active', 'N', 0, 'N', 'N', 'N'),
(45, 16, 'video', 'youtube', 'Bo v thng tin mt khu', NULL, 'bao-ve-thong-tin-mat-khau', 'Phn cu hnh thng tin ca Server bn l rt quan trng chn hn nh mt khu database, mt khu dch v sendmail... Vic bo v n l cn thit do  bn nn t n vo mt tp tin no , khng nn khai bo thng tin mt khu  khp mi ni  trnh b hacker tn cng\r\n\r\nNgoi ra vic t cc thng tin vo mt tp tin cu hnh gip ta qun l code d dng hn.  xem nhiu video bn c th truy cp vo website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/O1NqsU6Nikc/mqdefault.jpg', NULL, 'O1NqsU6Nikc&feature=youtu.be', '0:10:12', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec', 580, 0, 1490673274, 1490766347, 1490766347, 'active', 'N', 0, 'N', 'N', 'N'),
(46, 16, 'video', 'youtube', 'Upload tp tin trong PHP(FORM-phn 3)', NULL, 'upload-tap-tin-trong-php-form-phan-3', 'Khi lm vic vi web ng c bit l vi PHP th vic upload tp tin nh hnh nh, video l khng th thiu, trong video ny ti s hng dn s dng hm $_FILES  x l file trong PHP\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/CWHWN5De-h4/mqdefault.jpg', NULL, 'CWHWN5De-h4', '0:26:20', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,upload,upload file trong php,php can ban', 157, 0, 1490932995, NULL, 1490933016, 'active', 'N', 0, 'N', 'N', 'N'),
(47, 16, 'video', 'youtube', 'X l Form trong PHP(Form-phn 1)', NULL, 'xu-ly-form-trong-php-form-phan-1', 'Mt trong nhng ng dng quan trng ca PHP  l gip tng tc x l d liu trn form ca ngi s dng. Nhm mc ch gip cp nht thng tin mt cch linh ng v d dng qun l chung hn bi s kt hp tuyt vi ca c s d liu. Tuy nhin  lm c iu y PHP yu cu form phi p ng 1 s quy nh chung t ra.\r\n\r\nPOST: Bo mt hn GET v d liu c gi ngm, khng xut hin trn URL.\r\n\r\nGET: D liu c gi tng minh, chng ta c th nhn thy trn URL, y l l do khin n khng bo mt so vi POST.\r\n\r\nGET thc thi nhanh hn POST v nhng d liu gi i lun c webbrowser cached li. Khi dng phng thc POST th server lun thc thi v tr v kt qu cho client, cn phng thc GET ng vi cng mt yu cu  webbrowser s xem trong cached c kt qu tng ng vi yu cu  khng v tr v ngay khng cn phi thc thi cc yu cu   pha server.\r\n\r\ni vi nhng d liu lun c thay i th chng ta nn s dng phng thc POST, cn d liu t thay i chng ta dng phng thc GET  truy xut v x l nhanh hn.', NULL, 'https://i.ytimg.com/vi/L8nIbVyC5Fs/mqdefault.jpg', NULL, 'L8nIbVyC5Fs&feature=youtu.be', '0:9:1', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec', 172, 0, 1490933576, NULL, 1491037434, 'active', 'N', 0, 'N', 'N', 'N'),
