(49, 16, 'video', 'youtube', 'Ci t Docker', NULL, 'cai-at-docker', ' ci t Docker th bn vo trang ch https://docs.docker.com/engine/installation/ sau  chn phin bn bn mun ci t.\r\n\r\nDocker c cng b ti Santa Clara, California, on March 15, 2013 bi Solomon Hykes ban u n vit bng Python nhng v sau n c vit li golang bi hiu nng ca n.\r\n\r\nBi v Docker s dng cng ngh LXC do  nu bn mun tm hiu sau hn th c th tham kho https://linuxcontainers.org/\r\n\r\nContainers N khng phi l mt Virtual Machines\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/LdWCZDaoMzU/mqdefault.jpg', NULL, 'LdWCZDaoMzU&feature=youtu.be', '0:2:37', 6, 'yt:quality=high,yt:crop=16:9,gsviec,cai dat docker,docker can ban,docker', 1209, 0, 1491403930, NULL, 1491403941, 'active', 'N', 0, 'N', 'N', 'N'),
