(55, 16, 'video', 'youtube', 'Chia s Image Docker thng qua Hub Docker', NULL, 'chia-se-image-docker-thong-qua-hub-docker', 'Th Docker l m ngun m nn hng ng theo tinh thn m ngun m nn bn mun chia s ci image bn va mi to trn my bn th lm th no. Trong video ny ti s hng dn bn\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/Uscg4b-q3rU/mqdefault.jpg', NULL, 'Uscg4b-q3rU&feature=youtu.be', '0:3:37', 6, 'php,yt:quality=high,yt:crop=16:9,gsviec,docker,chia se image docker', 473, 0, 1491406589, NULL, 1491406595, 'active', 'N', 0, 'N', 'N', 'N'),
(56, 16, 'video', 'youtube', 'T ng to image thng qua hub docker', NULL, 'tu-ong-tao-image-thong-qua-hub-docker', 'Trong video trc ti  hng dn cc bn cch to image docker trn my local bn, k  ti s hng dn cc bn dng hub.docker.com  t ng to image cho bn mt cch t ng mi khi bn commit code ln github\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/ZoDZLrr6330/mqdefault.jpg', NULL, 'ZoDZLrr6330', '0:6:20', 6, 'php,yt:quality=high,yt:crop=16:9,gsviec,github,hub docker,docker can ban', 427, 0, 1491407907, NULL, 1491407920, 'active', 'N', 0, 'N', 'N', 'N'),
(57, 16, 'video', 'youtube', 'Chy ng dng Web Wordpress thng qua hai container', NULL, 'chay-ung-dung-web-wordpress-thong-qua-hai-container', '### Chy ng dng Web Wordpress thng qua hai container\r\n\r\nBi ton t ra l bn mun chy Wordpress vi container Docker nhng khng phi mt ci Container mc nh Wordpress m bn mun chy thm mt container MySQL  lu tr c s d liu\r\n\r\nCc bn ch  rng bn thn ci Image Wordpress c th chy c m khng cn Image Mysql\r\n\r\n- Image MySQL: https://hub.docker.com/_/mysql\r\n\r\n- Imgage Wordpress: https://hub.docker.com/_/wordpress/\r\n\r\nTrc tin ti gi s bn  c sn 2 ci image  trn nu cha c th ch vic chy lnh sau:\r\n\r\n```\r\ndocker pull mysql\r\ndocker pull wordpress\r\n\r\n```\r\n\r\nSau  bn to mt container MySQL thng qua lnh sau:\r\n\r\n```\r\ndocker run --name mysqlwp -e MYSQL_ROOT_PASSWORD=wordpressdocker -d mysql\r\n\r\n```\r\n\r\nBy gi bn to container Wordpress s dng tham s --link  kt ni Image MySQL  trn thy v dng MySQL mc nh trong image Wordpress\r\n\r\n```\r\ndocker run --name wordpress --link mysqlwp:mysql -p 80:80 -d wordpress\r\n\r\n```\r\n\r\nC 2 container trn ti chy trong ch  background bn c th xc nhn thng qua lnh sau:\r\n\r\n```\r\ndocker ps\r\n\r\n```\r\n\r\nbn cng c th to container MySQL thng qua cc bin bn di, ti khuyn bn nn dg n trong thc t bi v chng ta khng nn dng mc nh user root trong MYSQL\r\n\r\n```\r\ndocker run --name mysqlwp -e MYSQL_ROOT_PASSWORD=wordpressdocker \\\r\n                                -e MYSQL_DATABASE=wordpress \\\r\n                                -e MYSQL_USER=wordpress \\\r\n                                -e MYSQL_PASSWORD=wordpresspwd \\\r\n                                -d mysql\r\n```\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/mVco1U9b_Ao/mqdefault.jpg', NULL, 'mVco1U9b_Ao&feature=youtu.be', '0:4:32', 6, 'php,yt:quality=high,yt:crop=16:9,gsviec,docker,khoa hoc docker can ban,cai dat wordpress tren docker', 512, 0, 1491451582, NULL, 1491451722, 'active', 'N', 0, 'N', 'N', 'N'),
(58, 16, 'video', 'youtube', 'Backup d liu MySQL ang chy trong mt Container', NULL, 'backup-du-lieu-mysql-ang-chay-trong-mot-container', 'Bi ton t ra l bn mun backup d liu MySQL m bn  ci t Wordpress trc ,  trnh mt d liu khi bn xo ci image MySQL\r\n\r\n### Gii php\r\n\r\nC kh l nhiu cc  lm nhng c hai cch  lm chuyn ny m ti cho l ph bin v c khuyn dng\r\n\r\n** Cch mt**: Bn dng cu lnh mysqldump trong MySQL m ta thng dng hng ngy  backup d liu.\r\n\r\n\r\n```\r\ndocker exec mysqlwp mysqldump --all-databases \\\r\n    --password=wordpressdocker > wordpress.backup\r\n                                    \r\n```\r\n\r\n**Cch hai**:  l bn mount volume(kt ni ni lu tr MySQL) ca Imgae Docker bn ra bn ngoi my ca bn, gi s ti mun lu tr vo th mc hin ti ti ang ng:\r\n\r\n```\r\npwd\r\n\r\n#/Users/phanbook/github/khoa-hoc-docker-can-ban/wordpress/testdb\r\n\r\n```\r\nbn chy lnh bn di sau:\r\n\r\n\r\n```\r\n\r\ndocker run --name mysqlwp -e MYSQL_ROOT_PASSWORD=wordpressdocker \\\r\n                                -e MYSQL_DATABASE=wordpress \\\r\n                                -e MYSQL_USER=wordpress \\\r\n                                -e MYSQL_PASSWORD=wordpresspwd \\\r\n                                -v $(pwd):/var/lib/mysql \\\r\n                                -d mysql\r\n\r\n```\r\n\r\nCch ny l bn phi chy trc tin nu nh bn  c sn ci container ri \r\n', NULL, 'https://i.ytimg.com/vi/s_9BSAxqb0k/mqdefault.jpg', NULL, 's_9BSAxqb0k&feature=youtu.be', '0:8:52', 6, 'yt:quality=high,yt:crop=16:9,gsviec,docker,docker can ban,backup mysql docker', 408, 0, 1491471566, NULL, 1491651572, 'active', 'N', 0, 'N', 'N', 'N'),
(59, 16, 'video', 'youtube', 'Chia s data gia my bn(Docker Host) vi Container', NULL, 'chia-se-data-giua-may-ban-docker-host-voi-container', '**Bi ton**: Th mc ch cui cng sau khi bn thit lp xong mi trng dev trn Docker th bn to th mc A trn my bn th trong container n s cng c th mc \r\n\r\n**Gii php**: Docker cung cp cho ta mt tham s -v  lm chuyn ny\r\n\r\n```\r\n$ ls\r\nDockerfile        docker-compose.yml  index.php       wordpress\r\nconf\r\n\r\n$ docker run  -p  8080:9000 -d -v $(pwd):/var/www/html gsviec/php  php -S 0.0.0.0:9000\r\n\r\n```', NULL, 'https://i.ytimg.com/vi/gDbkfpYOoys/mqdefault.jpg', NULL, 'gDbkfpYOoys&feature=youtu.be', '0:2:41', 6, 'yt:quality=high,yt:crop=16:9,gsviec', 378, 0, 1491471803, NULL, 1491651529, 'active', 'N', 0, 'N', 'N', 'N'),
