(62, 16, 'video', 'youtube', 'Ci t Drupal trn Docker', NULL, 'cai-at-drupal-tren-docker', 'Drupal l CMS m ngun m, min ph, xy dng trn cng ngh PHP. Drupal gip cho qu trnh pht trin website tr nn n gin.  ci t n th bn c kh l nhiu cch nhng trong video hm nay ti s hng dn bn cch ci t Drupal trn Docker Compose\r\n\r\nNu bn no c bt k cu hi th hy  bnh lun bn di ti s tr li cc bn', NULL, 'https://i.ytimg.com/vi/9gxjlEM8pX0/mqdefault.jpg', NULL, '9gxjlEM8pX0', '0:6:24', 6, 'yt:quality=high,yt:crop=16:9,gsviec, docker,khoa-hoc-docker', 232, 0, 1491750949, NULL, 1491751073, 'active', 'N', 0, 'N', 'N', 'N'),
