(68, 16, 'video', 'youtube', 'To ti khon trn Amazon Web Service', NULL, 'tao-tai-khoan-tren-amazon-web-service', 'Nh mi dch v  s dng n bn cn phi ng k, trc tin bn cn vo trang ch http://aws.amazon.com/\r\n\r\nBn cn phi c th visa  ng k nu cha c th ra ngn hng ACB lm mt ci ngay ch c 30 pht l c lin.\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/twyVw5_y908/mqdefault.jpg', NULL, 'twyVw5_y908&feature=youtu.be', '0:6:22', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,khoa hoc amazon can ban', 634, 0, 1492399144, NULL, 1492399156, 'active', 'N', 0, 'N', 'N', 'N'),
(69, 16, 'video', 'youtube', 'Tng quan IAM trong Amazon Web Service', NULL, 'tong-quan-iam-trong-amazon-web-service', 'AWS c kh l nhiu dich v nu nh khng phn quyn l cc k nguy him, do  AWS c cng c IAM dng  lm chuyn . Trong video ny ti s khi nim cn bn cho cc bn nh security groups v \"User\"\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/RWNoowdBSIw/mqdefault.jpg', NULL, 'RWNoowdBSIw&feature=youtu.be', '0:6:13', 6, 'yt:quality=high,yt:crop=16:9,gsviec,iam,aws', 398, 0, 1492400343, NULL, 1492400349, 'active', 'N', 0, 'N', 'N', 'N'),
(70, 16, 'video', 'youtube', 'Tng quan S3 trn AWS', NULL, 'tong-quan-s3-tren-aws', 'Trong video ny ti s gii thiu cn bn cch s dng S3 v gii thiu n l g.\r\n\r\nAmazon S3 l vit tt ca cm t Amazon Simple Storage Service: L dch v m my lu tr do  bn c th ti ln cc tp, cc ti liu, cc d liu ti v ca ngi dng hoc cc bn sao lu.\r\n\r\nBn c th xem bi vit ny https://gsviec.com/blog/amazon-s3-la-gi-va-tai-sao-ban-nen-dung-no\r\n\r\nTrong video ny ti s gii thiu cn bn cch s dng S3 v gii thiu n l g.\r\n\r\nAmazon S3 l vit tt ca cm t Amazon Simple Storage Service: L dch v m my lu tr do  bn c th ti ln cc tp, cc ti liu, cc d liu ti v ca ngi dng hoc cc bn sao lu.\r\n\r\nBn c th xem bi vit ny https://gsviec.com/blog/amazon-s3-la-gi-va-tai-sao-ban-nen-dung-no\r\n\r\n\r\n```\r\n\r\n{\r\n    \"Version\": \"2008-10-17\",\r\n    \"Statement\": [\r\n        {\r\n            \"Sid\": \"AllowPublicRead\",\r\n            \"Effect\": \"Allow\",\r\n            \"Principal\": {\r\n                \"AWS\": \"*\"\r\n            },\r\n            \"Action\": \"s3:GetObject\",\r\n            \"Resource\": \"arn:aws:s3:::<tn-bucket-ca ban>/*\"\r\n        }\r\n    ]\r\n}\r\n\r\n```', NULL, 'https://i.ytimg.com/vi/1PlWhYMMGVM/mqdefault.jpg', NULL, '1PlWhYMMGVM&feature=youtu.be', '0:11:2', 6, 'yt:quality=high,yt:crop=16:9,gsviec,s3,aws,cach dung aws can ban', 576, 0, 1492400395, NULL, 1492418117, 'active', 'N', 0, 'N', 'N', 'N');
