(71, 16, 'video', 'youtube', 'Li m u', NULL, 'loi-mo-au', 'Trong serie bi hc ny, bn s c cc khi nim cn bn v S3, EC2, Cch tnh chi ph dch v AWS, etc\r\n\r\nNgoi ra ti s hng dn bn cch s dng S3  cha hnh nh hoc Video cho website ca bn m c th l Wordpress\r\n\r\n xem chi tiet kho hc bn c th xem https://gsviec.com/playlist/khoa-hoc-amazon-web-service-can-ban', NULL, 'https://i.ytimg.com/vi/3R3kQJJIOw8/mqdefault.jpg', NULL, '3R3kQJJIOw8&feature=youtu.be', '0:1:3', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,khoa hoc aws', 722, 0, 1492506470, NULL, 1492506498, 'active', 'N', 0, 'N', 'N', 'N'),
(72, 16, 'video', 'youtube', 'c lng chi ph khi dng Amazon Web Service', NULL, 'uoc-luong-chi-phi-khi-dung-amazon-web-service', 'Bt k bn dng dch v l g th u tin u tin ca bn l chi ph do  trong video ny ti s hng dn bn cch tnh chi ph khi dng Amazon Web Service\r\n\r\nBn cng c th mun xem ba vit ny  hiu r hn https://gsviec.com/blog/cach-tinh-cho-phi-dung-dich-vu-amazon-web-service\r\n\r\nBn c th xem y  kha hc ti y https://gsviec.com/playlist/khoa-hoc-amazon-web-service-can-ban', NULL, 'https://i.ytimg.com/vi/Hy1QcIfPIVw/mqdefault.jpg', NULL, 'Hy1QcIfPIVw', '0:5:24', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,kho hoc aws,tinh toan chi phi aws', 363, 0, 1492506941, NULL, 1492506948, 'active', 'N', 0, 'N', 'N', 'N'),
(73, 16, 'video', 'youtube', 'S dng S3  lu tr cc tp satic', NULL, 'su-dung-s3-e-luu-tru-cac-tap-satic', 'Tu thuc vo m ngun hay ng dng ca bn th cch thc s dng S3 l khc nhau, nhng c mt iu l ging nhau  l t cc tp tin css, javascript, image, video trn ci bucket ca bn\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/47nuJ1maBk0/mqdefault.jpg', NULL, '47nuJ1maBk0&feature=youtu.be', '0:3:56', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,khoa hoc aws', 340, 0, 1492507185, NULL, 1492507193, 'active', 'N', 0, 'N', 'N', 'N'),
(74, 16, 'video', 'youtube', 'Kt hp hai dch v S3 v Cloudfront vi nhau', NULL, 'ket-hop-hai-dich-vu-s3-va-cloudfront-voi-nhau', 'Trong hai video trc ti  gii thiu cc bn S3 v Cloudfront l g ri v v trong video ny ti s gii thch cho bn lm th no kt hp hai dch v ny lm vic chung vi nhau\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/NbjfGx7xbNo/mqdefault.jpg', NULL, 'NbjfGx7xbNo&feature=youtu.be', '0:3:3', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,cloudfront,s3,khoa hoc aws', 304, 0, 1492507988, NULL, 1492507995, 'active', 'N', 0, 'N', 'N', 'N'),
(75, 16, 'video', 'youtube', 'Gii thiu CloudFront ca Amazon Web Service', NULL, 'gioi-thieu-cloudfront-cua-amazon-web-service', 'Amazon Cloudfront l mng CDN phn phi ni dung tnh v streaming ton cu ca Amazon. Khi bn s dng CDN s gip cho khch truy cp nhanh vo d liu my ch web gn h nht thay v phi truy cp vo trung tm d liu ca nh cung cp hosting bn ang dng.\r\n\r\nhttps://gsviec.com/blog/tang-toc-wordpress-voi-cloudfront', NULL, 'https://i.ytimg.com/vi/5ujzgWMZItE/mqdefault.jpg', NULL, '5ujzgWMZItE&feature=youtu.be', '0:9:7', 6, 'yt:quality=high,yt:crop=16:9,gsviec,cloudfront,khoa hoc amazon web service,aws', 389, 0, 1492508076, NULL, 1492508081, 'active', 'N', 0, 'N', 'N', 'N'),
(76, 16, 'video', 'youtube', 'Cu hnh Wordpress vi Cloudfront v S3', NULL, 'cau-hinh-wordpress-voi-cloudfront-va-s3', 'Vi nhng website c c th thng xuyn phi lu tr & chia s hnh nh hay video trong cc bi vit cng nh c cc nhm bn c phn b rng ri  cc vng min khc nhau trn th gii th website s chy kh l chm nhng nu dng S3 v CloudFront  gii quyt vn   th kh l ngon\r\n\r\n\r\n\r\nhttps://github.com/humanmade/S3-Uploads\r\nhttps://gsviec.com/blog/tang-toc-wordpress-voi-cloudfront', NULL, 'https://i.ytimg.com/vi/aVBoDznhZfg/mqdefault.jpg', NULL, 'aVBoDznhZfg', '0:12:12', 2, 'yt:quality=high,yt:crop=16:9,gsviec', 238, 0, 1492518428, NULL, 1492518433, 'active', 'N', 0, 'N', 'N', 'N'),
(77, 16, 'video', 'youtube', 'Cu hnh domain ca bn thy th cho domain AWS CloudFront', NULL, 'cau-hinh-domain-cua-ban-thay-the-cho-domain-aws-cloudfront', 'Nh mnh  ni  video trc th vic dng domain mc nh ca Cloufront l khng sao c nhng nu bn mun thy i n v vi l do nh nhn chuyn nghip hn, tt cho SEO...\r\n\r\n### Bi ton:\r\n\r\nGi s mnh c domain ca Cloudfront https://s3-us-west-2.amazonaws.com/lackky.shop/ gi mnh mun chuyn n thnh http://cdn.gsviec.com trong  gsviec l tn min ca ti v ti c quyn qun tr n\r\n\r\n### Gii quyt vn \r\n\r\nBn vo phn cu hnh ca mt CloudFront sau  chn edit s c mc cho bn thm vo, sau  vo phn qun tr DNS cp nht cho n tu thuc vo nh cp cp m n phn gii CNAME nhanh hay chm v ch Cloudfront deploy na.  hiu r hn bn hy xem video bn trn\r\n', NULL, 'https://i.ytimg.com/vi/NrG7vh-mL6Q/mqdefault.jpg', NULL, 'NrG7vh-mL6Q&feature=youtu.be', '0:5:6', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,cloudfront', 2, 0, 1492672656, NULL, 1492672900, 'private', 'N', 0, 'N', 'N', 'N'),
(78, 16, 'video', 'youtube', 'Cu hnh domain ca bn thy th cho domain AWS CloudFront', NULL, 'cau-hinh-domain-cua-ban-thay-the-cho-domain-aws-cloudfront', 'Nh mnh  ni  video trc th vic dng domain mc nh ca Cloufront l khng sao c nhng nu bn mun thy i n v vi l do nh nhn chuyn nghip hn, tt cho SEO...\r\n\r\n### Bi ton:\r\n\r\nGi s mnh c domain ca Cloudfront https://s3-us-west-2.amazonaws.com/lackky.shop/ gi mnh mun chuyn n thnh http://cdn.gsviec.com trong  gsviec l tn min ca ti v ti c quyn qun tr n\r\n\r\n### Gii quyt vn \r\n\r\nBn vo phn cu hnh ca mt CloudFront sau  chn edit s c mc cho bn thm vo, sau  vo phn qun tr DNS cp nht cho n tu thuc vo nh cp cp m n phn gii CNAME nhanh hay chm v ch Cloudfront deploy na\r\n\r\n hiu r hn bn hy xem video bn trn\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/NrG7vh-mL6Q/mqdefault.jpg', NULL, 'NrG7vh-mL6Q&feature=youtu.be', '0:5:6', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,cloudfront', 283, 0, 1492672697, NULL, 1492672706, 'active', 'N', 0, 'N', 'N', 'N'),
(79, 16, 'video', 'youtube', 'Gii thiu chng ch s Amazon', NULL, 'gioi-thieu-chung-chi-so-amazon', 'Chng ch s SSL (cn gi l chng th s SSL) c vai tr rt quan trng trong cc giao dch trc tuyn nh: t hng, thanh ton, trao i thng tin,... c bit l trong cc lnh vc thng mi in t, sn giao dch vng v chng khon, cng thanh ton, v in t, ngn hng in t, chnh ph in t. Khi c s dng, mi d liu trao i gia ngi dng v website s c m ha ( pha ngi gi) v gii m ( pha ngi nhn) bi c ch SSL mnh m nht hin nay.\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/_pSDABE5Wys/mqdefault.jpg', NULL, '_pSDABE5Wys&feature=youtu.be', '0:3:5', 6, 'yt:quality=high,yt:crop=16:9,gsviec', 293, 0, 1492672846, NULL, 1492672850, 'active', 'N', 0, 'N', 'N', 'N'),
(80, 16, 'video', 'youtube', 'Cu CNAME ca bn hay domain s dng chng ch s ca AWS', NULL, 'cau-cname-cua-ban-hay-domain-su-dung-chung-chi-so-cua-aws', 'Trong video trc ti  hng dn bn s dng domain ca bn thy v dng domain mc nh ca Amazon CloudFront nhng n c mt vn   l ci Domain ca bn cha c h tr https, V vy trong video ny ti s hng dn bn lm chuyn \r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/ZF_HyZ-PbR8/mqdefault.jpg', NULL, 'ZF_HyZ-PbR8&feature=em-upload_owner', '0:3:48', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,ssl,chung chi so amazon,cloudfront,cname', 252, 0, 1492672968, NULL, 1492672974, 'active', 'N', 0, 'N', 'N', 'N'),
(81, 16, 'video', 'youtube', 'Khc phc li timeout Vagrant', NULL, 'khac-phuc-loi-timeout-vagrant', 'Nu bn no  dng Vagant dev th c th gp trng hp l khi chy lnh vagrant add \"ten-box\", v d vagrant add phalconphp/xenial64Th sau khi chy vi pht bn s gp li timeout v tp tin ny qu ln. \r\n\r\n```\r\nAn error occurred while downloading the remote file. The error\r\nmessage, if any, is reproduced below. Please fix this error and try\r\nagain.\r\n\r\nSSL read: error:00000000:lib(0):func(0):reason(0), errno 54\r\n\r\n```\r\nTh trong video ny ti s hng dn cho bn cch khc phc chuyn . Nu cha bit Vagrant l g th c th xem bi vit [Cch s dng vagrant(https://gsviec.com/blog/gioi-thieu-vagrant)]\r\n\r\nTp tin meta.json trong video  trn:\r\n\r\n```\r\n{\r\n    \"name\": \"phalconphp/xenial64\",\r\n    \"versions\": [{\r\n        \"version\": \"1.1.4\",\r\n        \"providers\": [{\r\n            \"name\": \"virtualbox\",\r\n            \"url\": \"file:///Users/phanbook/Downloads/5e8a0513-5ba9-4da3-b178-e5cc16cd3c70\"\r\n        }]\r\n    }]\r\n}\r\n```', NULL, 'https://i.ytimg.com/vi/wpCTizk1AtY/mqdefault.jpg', NULL, 'wpCTizk1AtY', '0:3:48', 6, 'yt:quality=high,yt:crop=16:9,gsviec,vagrant,timepout', 426, 0, 1493178215, NULL, 1493178370, 'active', 'N', 0, 'N', 'N', 'N'),
(82, 16, 'video', 'youtube', 'Ci t Phalcon', NULL, 'cai-at-phalcon', 'Phalcon n l extension PHP do  bn c th ci t d dng trn Window hay LInux nhg trong video ny ti s hng dn bn cch ci t thng qua Docker\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com/playlist/khoa-hoc-phalcon-can-ban', NULL, 'https://i.ytimg.com/vi/zCXhMJJ9Djo/mqdefault.jpg', NULL, 'zCXhMJJ9Djo', '0:2:46', 9, 'yt:quality=high,yt:crop=16:9,gsviec,phalconphp,phalcon can ban,khoa hoc phalcon', 630, 0, 1493384305, NULL, 1493384312, 'active', 'N', 0, 'N', 'N', 'N'),
(83, 16, 'video', 'youtube', 'Ci t Phalcon Dev Tools', NULL, 'cai-at-phalcon-dev-tools', 'Chng ta c kh l nhiu cch ci t Phalcon Dev Tools, trc tin bn cn vo trang hng dn n ti y https://github.com/phalcon/phalcon-devtools\r\n\r\nCch s dng bn c th tham kho ng dn ny https://docs.phalconphp.com/en/latest/reference/tools.html\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com/playlist/khoa-hoc-phalcon-can-ban', NULL, 'https://i.ytimg.com/vi/U_nX4ZHw9mg/mqdefault.jpg', NULL, 'U_nX4ZHw9mg', '0:2:10', 9, 'yt:quality=high,yt:crop=16:9,gsviec,phalconphp,phalcon can ban,phalcondev tool', 624, 0, 1493384347, NULL, 1493384353, 'active', 'N', 0, 'N', 'N', 'N'),
(84, 16, 'video', 'youtube', 'To khung sng ng dng Phalcon PHP', NULL, 'tao-khung-suong-ung-dung-phalcon-php', 'Khng ging nh cc FW PHP khc khi bn ci t Phalcon n ch l mt extendion do  bn cn phi t to cc khung sn cho d n ring ca bn, do  bn c th tu bin d dng y cng chnh l mt trong im mnh ca Phalcon PHP nhng cng chnh l im yu ca n, nu bn no theo trng phi chp nhn cc quy nh ca ngi pht trin FW , chn hn nh Laravel hay ruby on rails bn ch ly ci mu Sekeleton ca h thi, ch cn tu bin li th nt bt ht.\r\n\r\nV d bn th tu bin Laravel thnh modular structure th xem, th my ci lnh artisan ca n banh chnh lun, nhng khng th ph nhn nu bn dng nhng tu chn mc nh t Laravel th d n bn code cc nhanh.\r\n\r\nhttps://github.com/phalcon/mvc\r\n\r\nKhi bn t tay thit k mt ci Sekeleton th bn s hiu c nhng g vn hnh ca d n bn\r\n\r\nphalcon project phalcon-canban  --enable-webtools', NULL, 'https://i.ytimg.com/vi/YJrCSvMEeQI/mqdefault.jpg', NULL, 'YJrCSvMEeQI', '0:2:9', 9, 'yt:quality=high,yt:crop=16:9,gsviec,phalconphp,phalcon can ban', 721, 0, 1493384717, NULL, 1493384766, 'active', 'N', 0, 'N', 'N', 'N'),
(85, 16, 'video', 'youtube', 'Chn IDE ph hp  pht trin ng dng Phalcon PHP', NULL, 'chon-ide-phu-hop-e-phat-trien-ung-dung-phalcon-php', 'Nh bn bit l  vit code PhalconPHP th ta c th dng notepad  vit cng c nhng khng ai lm th c, v vy ti s a cho bn nhng li khuyn chn IDE hay Editor hp l khi bt u hc Phalcon\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com/playlist/khoa-hoc-phalcon-can-ban', NULL, 'https://i.ytimg.com/vi/AvlKfNyGVeU/mqdefault.jpg', NULL, 'AvlKfNyGVeU', '0:2:0', 6, 'yt:quality=high,yt:crop=16:9,gsviec,ide,phalconphp,phalcon ide', 245, 0, 1493384809, NULL, 1493385244, 'active', 'N', 0, 'N', 'N', 'N'),
(86, 16, 'video', 'youtube', 'Gii thiu class Config ca Phalcon PHP', NULL, 'gioi-thieu-class-config-cua-phalcon-php', 'Phalcon cung cp cho ta kh l nhiu cch c tp cu hnh thng qua nh dng tp tin nh php, yaml, json, ini bn c th xem chi tit ti y https://docs.phalconphp.com/en/latest/reference/config.html\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/lYxyikoUNQU/mqdefault.jpg', NULL, 'lYxyikoUNQU', '0:6:7', 9, 'yt:quality=high,yt:crop=16:9,gsviec,config,phalcon can ban', 526, 0, 1493384836, NULL, 1493384842, 'active', 'N', 0, 'N', 'N', 'N'),
(87, 16, 'video', 'youtube', 'Gii thiu kha hc Phalcon PHP', NULL, 'gioi-thieu-khoa-hoc-phalcon-php', 'Trong hn 4 nm qua ti  nghin cu v lm vic trn Phalcon Framework  xy dng ng dng online theo yu cu ca khch hng. Trong qu trnh xy v pht trin dng d n cho khch hng, chng ti  nhn thy nhng u im vt tri ca Phalcon framework so vi cc PHP framework\r\n\r\nV vy ti quyt nh m kha hc Phalcon ny  chia s nhng hiu bit ca ti cho cc bn tr mun hc Phalco  xem nhiu video bn c th truy cp vo website: https://gsviec.com/playlist/khoa-hoc-phalcon-can-ban', NULL, 'https://i.ytimg.com/vi/Ac1V0LuNJ-E/mqdefault.jpg', NULL, 'Ac1V0LuNJ-E', '0:2:3', 9, 'yt:quality=high,yt:crop=16:9,gsviec,phalcon,khoa hoc phalcon', 8781, 0, 1493384304, NULL, 1493384304, 'active', 'N', 0, 'N', 'N', 'N'),
(88, 16, 'video', 'youtube', 'Gii thiu tnh nng Loader', NULL, 'gioi-thieu-tinh-nang-loader', 'Documents: https://docs.phalconphp.com/en/latest/reference/loader.html\r\n\r\nAPI: https://docs.phalconphp.com/en/latest/api/Phalcon_Loader.html\r\n\r\nKhi bn lm vic vi PHP th bn c s dng cc hm include, required  np file vo nhng ci ny ch hp l vi d n bn ci vi tp tin thi, ch d n ln m c hng trm file th bn dng hm include l khng n, do  Phalcon n cung cp cho bn mt th vin Phalcon\\Loader\r\n\r\nLazy loading l k thut rt quan trng trong lp trnh hng i tng. V nh c n ta c th tit kim c rt nhiu thao tc gi np file khi s dng. Bn thn lazy loading s dng magic method (cc phng thc c bit trong PHP)  triu gi d liu. C th l phng thc __autoload(). https://en.wikipedia.org/wiki/Lazy_initialization\r\n\r\n- Registering Namespaces\r\n\r\n- Registering Directories\r\n\r\n- Registering Classes\r\n\r\n- Registering Files\r\n\r\nhttps://gsviec.com/playlist/khoa-hoc-phalcon-can-ban', NULL, 'https://i.ytimg.com/vi/pFIeaRBbwk0/mqdefault.jpg', NULL, 'pFIeaRBbwk0', '0:13:51', 9, 'yt:quality=high,yt:crop=16:9,gsviec,phalcon,phalcon can ban', 3081, 0, 1493521947, NULL, 1493521956, 'active', 'N', 0, 'N', 'N', 'N'),
(89, 16, 'video', 'youtube', 'Gii thiu routing trong Phalcon', NULL, 'gioi-thieu-routing-trong-phalcon', 'Route dch ra c ngha l tuyn ng, nghe chng c t g lin quan n lp trnh nhng ta c th hiu rng route n nm vai tr ch ng cho yu cu (request) i n u. \r\n\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com/playlist/khoa-hoc-phalcon-can-ban', NULL, 'https://i.ytimg.com/vi/ZbNV_NtWKSo/mqdefault.jpg', NULL, 'ZbNV_NtWKSo', '0:2:39', 9, 'yt:quality=high,yt:crop=16:9,gsviec,phalcon can ban,phalconphp,router', 3139, 0, 1493522382, NULL, 1493522387, 'active', 'N', 0, 'N', 'N', 'N'),
