(121, 16, 'video', 'youtube', 'Gii thiu LEMP v ci t nginx', NULL, 'gioi-thieu-lemp-va-cai-at-nginx', 'LEMP l mt nhm cc phn mm m ngun m c ci trn my ch Webserver, c vit tt t Linux, NGINX (Engine x), MySQL, v PHP. LEMP tng t nh LAMP ch khc web server trn nn tng Nginx thay v Apache. c im Nginx l mt web server m ngun m hot ng nhanh v  t ti nguyn h thng hn Apache. i vi cc h thng nh s khc nhau gia Apache v Nginx l khng ng k, tuy nhin  cc h thng nng th Nginx th hin s vt tri hn rt nhiu so vi Apache.\r\n\r\nhttps://gsviec.com/blog/huong-dan-cai-dat-lemp-tren-centos', NULL, 'https://i.ytimg.com/vi/D36ZkaKA3rk/mqdefault.jpg', NULL, 'D36ZkaKA3rk&feature=youtu.be', '0:7:4', 6, 'yt:quality=high,yt:crop=16:9,gsviec,nginx,lemp,lamp', 835, 0, 1500346536, NULL, 1500346541, 'active', 'N', 0, 'N', 'N', 'N'),
