(126, 16, 'video', 'youtube', 'Hng dn s dng Queue trong Phalcon phn 1', NULL, 'huong-dan-su-dung-queue-trong-phalcon-phan-1', 'Hm nay trong video ny ti s hng dn bn s dng mt th vin php-resque tng tc queue, nh cc bn bit c kh nhiu dch v nh RabbitMQ, Beanstalk, etc, ti sao ti li dng n th nht v th vin ny vit bng PHP, sau  n li kt hp vi Redis  lu tr cc thng tin ca jobs queue , v tt nhin n kh l d s dng\r\n\r\n### Bn cn ci t cc thnh phn sau:\r\n\r\n- Redis server https://redis.io/\r\n\r\n- Th vin PHP cho Redis ti https://github.com/phpredis/phpredis\r\n\r\n- Th vin Workers and Queueing mail\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com/playlist/khoa-hoc-phalcon-102', NULL, 'https://i.ytimg.com/vi/pDMhbUKleM4/mqdefault.jpg', NULL, 'pDMhbUKleM4&feature=youtu.be', '0:3:45', 9, 'yt:quality=high,yt:crop=16:9,gsviec,queue,phalcon can ban', 750, 0, 1503114487, NULL, 1503114499, 'active', 'N', 0, 'N', 'N', 'N'),
