(133, 16, 'video', 'youtube', 'Debug volt trong Phalcon vi Xdebug', NULL, 'debug-volt-trong-phalcon-voi-xdebug', 'Nh bn bit th mt nh cc IDE n khng h tr t breakpoin trong cc template nh twig, hay volt vy lm th no  t breakpoint cho n, trong video ny ti s hng dn cc bn\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/XmUAXyGknE4/mqdefault.jpg', NULL, 'XmUAXyGknE4&feature=youtu.be', '0:1:46', 9, 'yt:quality=high,yt:crop=16:9,gsviec,volt,phalcon,phpstorme', 471, 0, 1505643229, NULL, 1505643238, 'active', 'N', 0, 'N', 'N', 'N'),
