(136, 16, 'video', 'youtube', 'Gii thiu Amazon Relation Service phn 1', NULL, 'gioi-thieu-amazon-relation-service-phan-1', 'Dch v Amazon Relation Database mt trong nhng dch v ph bin nht m c th l MySQL, nu bn mun tm hiu n th video ny dnh cho bn\r\n\r\nBn cng c th xem slide ca ti ti y https://speakerdeck.com/duythien/introdution-amazon-relation-service\r\n\r\n xem nhiu video v AWS  bn c th truy cp vo website: https://gsviec.com/playlist/khoa-hoc-amazon-web-service-can-ban-002', NULL, 'https://i.ytimg.com/vi/PFeRsoqZLDQ/mqdefault.jpg', NULL, 'PFeRsoqZLDQ&feature=youtu.be', '0:10:22', 6, 'yt:quality=high,yt:crop=16:9,gsviec,mysql,aws,aws-database', 257, 0, 1509161065, NULL, 1509161093, 'active', 'N', 0, 'N', 'N', 'N'),
