INSERT INTO `posts` (`id`, `usersId`, `type`, `techOrder`, `title`, `link`, `slug`, `content`, `excerpt`, `thumbnail`, `filename`, `videoFilename`, `duration`, `categoryId`, `tags`, `numberViews`, `numberReply`, `createdAt`, `modifiedAt`, `editedAt`, `status`, `locked`, `deleted`, `acceptedAnswer`, `monetize`, `sticked`) VALUES
(138, 16, 'video', 'youtube', 'Gii thiu Amazon Route 53', NULL, 'gioi-thieu-amazon-route-53', 'Trong video ny chng ti s hng dn bn cch cu hnh Route 53 trn godady.com cng nh gii thiu s qua trang qun tr Route 53\r\n\r\nAmazon Route 53 l mt dch v dng  qun l DNS, do  nu bn cha hiu DNS l g c th xem bi vit ny https://gsviec.com/blog/dns-la-gi. Thng thng khi bn mua mt tn min(domain) t nh cung cp dch v h s cung cp cho bn dch v DNS lun, v d godady l\r\n\r\n```\r\nns01.domaincontrol.COM\r\nns02.domaincontrol.COM\r\n\r\n```\r\n\r\nNgoi ra cc nh cung cp dch v nh linode h cung s cung cp min ph cho cc bn, bn c th kim tra gsviec.com dng nh cung cp no thng qua lnh sau:\r\n\r\n\r\n```\r\ndig gsviec.com any\r\n\r\ngsviec.com.       21599   IN  NS  ns5.linode.com.\r\ngsviec.com.      21599   IN  NS  ns1.linode.com.\r\ngsviec.com.      21599   IN  NS  ns3.linode.com.\r\ngsviec.com.      21599   IN  NS  ns2.linode.com.\r\ngsviec.com.      21599   IN  NS  ns4.linode.com.\r\n\r\n```\r\n\r\nNh bn thy cc nh cung cp khc  cho bn min ph, nhng Route53 khng c min ph, vy chng ta c cn n khng? cu tr li ca chng ti l **c v khng** ph thuc vo d n v kin trc h thng ca server bn\r\n\r\nNu bn l c nhn hay t chc va v nh v khng dng dch v ca AWS [Route 53](https://aws.amazon.com/route53/)  th chng ti khuyn cc bn khng nn dng n. Nhng nu kin trc h thng bn s dng nn tng Route 53 th chc chn bn nn dng, di y chng ti s a l do ti sao bn nn dng.\r\n\r\n\r\n### Ti sao nn dng Route 53\r\n\r\n- Chi ph cc k r: $0.400 per million queries  first 1 Billion queries / month\r\n\r\n- Cung cp healthy  kim tra service ca bn cn hot ng hay khng rt l tin li cho vic cu hnh load balancer(Healthy and Weighted Routing Policy)\r\n\r\n- Cung cp cc policy(chnh sch) iu hng lng trafic n cc service ca bn\r\n\r\n- S phn hi cc k nhanh chng(Latency based Routing Policy)\r\n\r\n- Phn gii tn min trong mng ni b (Private DNS)\r\n\r\n- Bn c th mua domain t Route 53(Domain Registration)\r\n\r\n- Cung cp cc tnh nng vng min trn th gii  iu hng ngi dng tng ng( Geolocation Routing Policy)\r\n\r\n\r\n', NULL, 'https://i.ytimg.com/vi/Qym6kAEfNnM/mqdefault.jpg', NULL, 'Qym6kAEfNnM&feature=youtu.be', '0:9:22', 6, 'yt:quality=high,yt:crop=16:9,aws,route53,dns', 711, 0, 1509875069, NULL, 1509875153, 'active', 'N', 0, 'N', 'N', 'N'),
(139, 16, 'video', 'youtube', 'Cch cu hnh Xdebug  trong PhalconPHP', NULL, 'cach-cau-hinh-xdebug-trong-phalconphp', 'Nh bn bit th vic ci t Xdebug trong Docker cng khng khc l my so vi vic ci t thng thng trn my ca bn, nhng nu bn gp kh khn th video ny dnh cho bn\r\n\r\nFile cu hnh Docker v Xdebug bn c th ti ti y https://github.com/gsviec/phalcon-canban\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com/playlist/khoa-hoc-phalcon-102', NULL, 'https://i.ytimg.com/vi/8qI3g0wHFrQ/mqdefault.jpg', NULL, '8qI3g0wHFrQ', '0:7:11', 120, 'yt:quality=high,yt:crop=16:9,gsviec,docker,phalcon,xdebug,phpstorm', 125, 0, 1511672882, NULL, 1511672899, 'active', 'N', 0, 'N', 'N', 'N'),
(140, 16, 'video', 'youtube', 'Gii thiu AMI trong EC2', NULL, 'gioi-thieu-ami-trong-ec2', 'Nu bn mun tit kim thi gian vic to i to li cc dch v nh LEMP, LAMP, vng vng hoc mun dng Elastic load balancing ca AWS th phn AMI l khng th b qua, trong video ny chng ti s hng dn cc bn lm cch to AMI\r\n\r\nHy tng tng n gin n ging nh mt bn ghost vy .  Chng ta c th d dng to ra cc EC2 Instance vi config ging y ht nhau t AMI ca primary Instance . y s l cch  thc hin back up trong nhng trng hp m ta mun thay i config hay  to EC2 Instance s dng cho ELB  . Mt im th v na l ta c th thc hin mua bn cc AMI ny . Nu bn cho rng AMI ca bn l c bit , hy a chng ln AWS Market Place , bit u li c bt ng cho thu nhp ca bn \r\n\r\nNgun t http://awslagi.com/huong-dan-tao-ami-amazon-machine-image/\r\n\r\nCode cho video ny:\r\n\r\n```\r\n<?php\r\n$this_instance_id = file_get_contents(\'http://169.254.169.254/latest/meta-data/instance-id\');\r\nif(!empty($this_instance_id))\r\n   echo (string)($this_instance_id);\r\nelse\r\n   echo \"Sorry, instance id unknown\";\r\n```', NULL, 'https://i.ytimg.com/vi/_qf3-OnhIP4/mqdefault.jpg', NULL, '_qf3-OnhIP4', '0:7:7', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,ec2,ami', 236, 0, 1511673473, NULL, 1511676577, 'active', 'N', 0, 'N', 'N', 'N'),
(141, 16, 'video', 'youtube', 'Cch to Elastich Load Balancing trong AWS', NULL, 'cach-tao-elastich-load-balancing-trong-aws', 'Nh bn bit th Elastic Load Balancing l mt trong nhng dch v quan trng v c dng kh l thng xuyn nu nh cc bn c nh dng dch v ca AWS, v vy trong video hm nay chng ti s hng dn bn cch to Elastic Load Balancing\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/AePO-3lUhTY/mqdefault.jpg', NULL, 'AePO-3lUhTY', '0:11:43', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,elb,elastic-load-balancer', 315, 0, 1511674784, NULL, 1511674790, 'active', 'N', 0, 'N', 'N', 'N'),
(142, 16, 'video', 'youtube', 'T ng m rng EC2(auto scale ec2)', NULL, 'tu-ong-mo-rong-ec2-auto-scale-ec2', 'Trong video trc ti  hng dn cc bn cch to ELB l g ri, nhng n vn cha c tnh nng scale t ng, trong video ny ti s hng dn cc bn lm chuyn \r\n\r\nNu bn a ra chnh sch m rng (Scaling Policies) sau  Auto Scaling c th khi chy hoc xo b instance theo nh nhu cu ng dng ca bn tng thm hoc gim bt. => Gi s: web ca bn full ti CPU, RAM ti a c 1k user truy cp cng 1 lc. Bn s dng policy  khi CPU, RAM full th h thng s t ng add thm instance mi vo  gim ti cho server, ELB c trch nhim chia u request cho cc instance, khi  CPU, RAM ko  full na.\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/ye3_FW3AjWY/mqdefault.jpg', NULL, 'ye3_FW3AjWY&feature=youtu.be', '0:11:27', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,ec2,auto-scale-ec2,elb', 311, 0, 1511676122, NULL, 1511676776, 'active', 'N', 0, 'N', 'N', 'N'),
(143, 16, 'video', 'youtube', 'Hello world trong Docker', NULL, 'hello-world-trong-docker', 'Nh mi cng ngh v ngn ng lp trnh th ng dng Hello World lun lun c dng  th ngn ng  hay cng ngh \n\n xem nhiu video bn c th truy cp vo website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/KZPqdqAOBUE/mqdefault.jpg', NULL, 'KZPqdqAOBUE', '0:3:0', 120, 'php,yt:quality=high,yt:crop=16:9,gsviec', 296, 0, 1513147134, NULL, 1513147134, 'active', 'N', 0, 'N', 'N', 'N'),
(144, 16, 'video', 'youtube', 'Cch dng cn bn ElastichSearch trn AWS', NULL, 'cach-dung-can-ban-elastichsearch-tren-aws', 'Trong video trc chng ti  hng dn cc bn cch setup n trn AWS nh th no ri, trong video ny chng ti s demo mt v d nh v cch s dng n, m c th l phn tch log h thng v nginx\r\n\r\nBn cng c th xem demo server link ny https://search-lackky-ojizzlhc54j33o3cmrgb274qsi.ap-southeast-1.es.amazonaws.com/_plugin/kibana/\r\n\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/aSJIDwAwBI4/mqdefault.jpg', NULL, 'aSJIDwAwBI4&feature=youtu.be', '0:7:32', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,aws elastichsearch service,kibana', 295, 0, 1514259224, NULL, 1514259234, 'active', 'N', 0, 'N', 'N', 'N'),
(145, 16, 'video', 'youtube', 'To mt con ElastichSearch trn AWS', NULL, 'tao-mot-con-elastichsearch-tren-aws', 'Trong video ny chng ti hng dn cc bn cch to mt con elastich trn AWS\r\n\r\nNu bn no cha bit Elastich l g c th truy cp thng qua website ny  hiu https://www.elastic.co/\r\n\r\nBn c th xem kt qu ti link ny https://search-lackky-ojizzlhc54j33o3cmrgb274qsi.ap-southeast-1.es.amazonaws.com/\r\n xem nhiu video bn c th truy cp vo website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/tWRXBeKiH24/mqdefault.jpg', NULL, 'tWRXBeKiH24&feature=youtu.be', '0:6:29', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,elastich,kibana', 328, 0, 1514259500, NULL, 1514259505, 'active', 'N', 0, 'N', 'N', 'N');
